  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;Electrical Impendance Tomography
  (EIT) utilizes a series of electrodes in a circumferential band-like device feeding
  these signals to a portable computer that generates images similar to a Computerized
  Tomography (CT) scan using a mathematical algorithm.The development and validatation
  of this new technoligy could provide reliable portable imaging of the head and chest
  cavity through the use of EIT. Impedance has been used to gain knowledge of cardiac
  function for several decades but not used as a scanning technique.&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Still
  early in development, Electrical Impedance Tomography Technology (EITT) is designed
  to provide images allowing doctors to monitor a patient&amp;#39;s airflow or blood
  flow. While tools such as X-ray, magnetic resonance imaging (MRI) and ultrasound
  are well known, they don&amp;#39;t work well in a space environment due to radiation,
  user training, size and power usage considerations. These same limitations exist
  in remote locations on Earth.&lt;/p&gt;&lt;p&gt;The EITT device is a belt of electrodes
  worn around the portion of the body to be imaged. Once placed on a patient, it sends
  its observations to a computer, which then converts that signal to a still image
  or even a stream of live data. This information can be sent from space to the ground,
  or from remote locations anywhere in the world.&lt;/p&gt;\",\n\t\"license_title\":
